import React from 'react'
import Highcharts from 'highcharts'
import HighchartsReact from 'highcharts-react-official'

const options = {
    title: {
        text: 'My chart'
    },
    series: [{
        data: [1, 2, 3]
    }]
}

export default () =>
    <HighchartsReact
        highcharts={Highcharts}
        options={options}
    />

//export default () => <p>Gráfico Top... wow much graph</p>
